import React from 'react';
import '../App.css';

function About() {
  const spanStyle = {
    fontSize: '30px'
  }
    return (
      <div className="mainDiv">
        <div className="divContent">
          <p className="customP">02.</p><h1 style={spanStyle}>About me</h1>
          <p>I like team work using agile methodology, makes me able to deliver high-quality products.</p>
          <p>Here's a few technologies I've been working with recently:</p>
          <p className="customP">JAVASCRIPT | REACT | HTML5 | CSS3</p>
          <p className="customP">PHOTOSHOP | FIREBASE | FIGMA | WORDPRESS</p>
          <ol>
            <li className="customP">Javascript</li>
            <li className="customP">React</li>
            <li className="customP">HTML5</li>
            <li className="customP">CSS3</li>
          </ol>
        </div>
      </div>
    );
  }
  
  export default About;
